import React, { useState } from "react";

function App() {
  const [count,setCount] = useState(0)
  const CartButtonHandler = () =>{
    setCount(count+1)
  }
  return (
    <div>
      <h1>Big T-shirt Mall</h1>
      <button onClick={CartButtonHandler}>Cart {count}</button>
    </div>
  );
}

export default App;
